import React from "react";
import { Link } from "react-router-dom";

// function deletePark() {
//     fetch('/park',{method:"DELETE",
//       headers:{"Content-Type":"application/json"}
//     })
//   }

function ParkItem({name,image_url,description,location,prices}){
    return(
        <div className="parksitem">
            <img src={image_url} alt={name}/>
            <h4>Name: {name}</h4>
            <p>Description: {description} </p>
            <p>Location: {location}</p>
            <p>Price {prices}</p> <br></br>

            <Link to={"/bookings"}><button className="bk1">Delete</button></Link><br></br><br></br>
            <Link to={"/updpark"}><button className="dl3">Delete</button></Link><br></br><br></br>
            <Link to={"/oneprk"}><button className="dl3">Delete</button></Link><br></br><br></br>
        </div>
    )
}

export default ParkItem
